import React from "react";
import "./style.css";
import profileImg from "../../img/profile.jpg";

const profileImgStyle = {
    position: "relative",
    height: "20%",
    width: "17%",
    borderRadius: "7%",
    border: "solid wheat 2px",
    margin: "2%",
    marginRight: "75%"
}

const AboutMe = () => {
    return ( <>
        <div className="aboutme">
            <h1 className="hello">Hello, my name is Juliana Andrews</h1>
            <img style={ profileImgStyle } src={ profileImg } alt="Juliana Andrews Profile Photo" />
            <hr />
            <ul>
                <li>HTML5</li> <li>CSS</li>
                <li>JavaScript</li>
                <li>jQuery</li>
                <li></li>
            </ul>
        </div>        
    </>
    )
}

export default AboutMe;
